class Solution {
    public List<Integer> removeDuplicates(List<Integer> numbers) {
        Set<Integer> seen = new HashSet<>();
        List<Integer> result = new ArrayList<>();
        for (int i : numbers) {
            if (!seen.contains(i)) {
                result.add(i);
