class Solution {
    public List<Integer> evenOddPalindrome(int n) {

        int even_palindrome_count = 0;
        int odd_palindrome_count = 0;

        for (int i = 1; i < n; i++) {
            if (isPalindrome(i)) {
                if (i % 2 == 1) {
                    odd_palindrome_count++;
                } else {
                    even_palindrome_count++;
                }
            }
        }
        return Arrays.asList(even_palindrome_count, odd_palindrome_count);
    }

    private boolean isPalindrome(int num) {
        String str = String.valueOf(num);
        return str.equals(new StringBuilder(str).reverse().toString());
    }
}

